class Room:
	def __init__(self,name):
		self.doors = []
		self.name = name
		self.fromFile(name)
		self.tiles = None
		self.mobs = []
		self.players = []

	def addPlayer(self,player):
		self.players.append(player)

	def removePlayer(self,player):
		del self.players[self.players.index(player)]

	def fromFile(self,file):
		try:
			newFile = open(file,'r')
			self.array = json.load(newFile)
		except:
			newFile = open(file, 'w+')
			newFile.write(blankWorld)
			self.array = json.loads(blankWorld)
		newFile.close()
		self.width = len(self.array[0])
		self.height = len(self.array)

	def addMob(self, mob):
		self.mobs.append(mob)

	def saveArray(self,file):
		with open(file, 'w') as f:
			f.truncate()
			json.dump(self.array,f)

	def getPosVal(self, x, y):
		return self.array[y][x]

	def getPosChar(self, x, y):
		if int(self.getPosVal(x,y)) == self.getPosVal(x,y):
			return self.tiles[self.getPosVal(x,y)].getChar()
		else:
			return self.doors[int(self.getPosVal(x,y))].getChar()

	def getColor(self,x,y):
		if int(self.getPosVal(x,y)) == self.getPosVal(x,y):
			return self.tiles[self.getPosVal(x,y)].getCol()
		else:
			return self.doors[int(self.getPosVal(x,y))].getCol()

	def getTile(self, x,y):
		if int(self.getPosVal(x,y)) == self.getPosVal(x,y):
			return self.tiles[self.getPosVal(x,y)]
		else:
			return self.doors[int(self.getPosVal(x,y))]

	def getTileName(self,x,y):
		if int(self.getPosVal(x,y)) == self.getPosVal(x,y):
			return self.tiles[self.getPosVal(x,y)].getName()
		else:
			return self.doors[int(self.getPosVal(x,y))].getName()

	def setTile(self,tile,x,y):
		self.array[y][x] = tile


